** We define the set of natural numbers, ℕ, as follows:

ℕ := {0, 1, 2,...}

where each element is a finite ordinal number.

** Let ℕ denote the set of natural numbers, and let S be a formal system defined as follows:

* The language of S consists of:
	+ A countable set of variables {x, y, z,...}
	+ A set of constant symbols {0, 1, 2,...}
	+ A set of binary operation symbols {+, ×}
	+ A set of relation symbols ={=, <, >}
* The axioms of S are the usual Peano axioms for natural numbers, plus the following additional axiom schemata:
	+ ∀x∀y (x + y = y + x) (Commutativity of Addition)
	+ ∀x∀y∀z (x + (y + z) = (x + y) + z) (Associativity of Addition)
	+ ∀x (x + 0 = x) (Identity Element for Addition)
* The rules of inference for S are modus ponens and universal instantiation.
